import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";
import Dashboard from "./component/dashboard";
import Home2 from "./component/home2";
import "./App.css";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Routes>
            <Route
              path="/"
              element={<Dashboard />}
            ></Route>
            <Route
              path="/home2"
              element={<Home2 />}
            ></Route>
          </Routes>
        </div>
      </Router>
    );
  }
}

export default App;
